### 题目链接
[luogu](https://www.luogu.com.cn/problem/AT_arc160_b)

[atcoder](https://atcoder.jp/contests/arc160/tasks/arc160_b)

### 题目大意

给出一个正整数 $n$。

求出满足以下条件的正整数三元组 $(x,y,z)$ 的数量，取模 $998244353$：

- $xy,yz,zx$ 都小于或等于 $n$。

多组数据。$1 \le T \le 100,1 \le n \le 10^9$。

### 思路

令 $m=\lfloor \sqrt{n} \rfloor$。

对 $x,y,z$ 的值分类讨论：

1. $\max(x,y,z) \le m$。

   此时 $x,y,z$ 两两乘积一定都小于 $n$。

   每个值都可以取 $[1,m]$ 中的整数，方案数为 $m^3$。

2. $\max(x,y,z) > m$。

   若 $\max(x,y,z)=x$，那么因为 $xy \le n,xz \le n$，所以 $y$ 和 $z$ 一定都小于 $m$。这就同时满足了 $yz \le n$。

   考虑枚举 $x$。那么 $y,z \in[1,\lfloor \frac{n}{x} \rfloor ]$。所以 $y,z$ 的取值方案数为 $\lfloor \frac{n}{x} \rfloor ^2$。不考虑 $x$ 在三元组中的位置，则 $x$ 三个位置都可以放，剩下两个位置就有上述方案，所以总方案数就是 $3 \cdot \lfloor \frac{n}{x} \rfloor ^2$。

   显然这个式子[数论分块](https://oi-wiki.org/math/number-theory/sqrt-decomposition/)一下就做完了，注意 $x \in (\sqrt{n},n]$。

时间复杂度 $O(T\sqrt{n})$。

#### code

```cpp
#include<bits/stdc++.h>
using namespace std;
#define mod 998244353
#define ll long long
ll n;
void solve(){
	cin>>n;
	ll m=sqrt(n),ans=0;
	ans+=m*m*m%mod;//分类1
	for(ll l=m+1,r;l<=n;l=r+1){//分类2，枚举x
		r=n/(n/l);
		ll lim=n/l;
		ans+=lim*lim*3%mod*(r-l+1)%mod;
		ans%=mod;
	}
	cout<<ans<<'\n';
	return;
}
int main(){
	ios::sync_with_stdio(0);
	cin.tie(0);cout.tie(0);
	int t;cin>>t;
	while(t--)solve();
	return 0;
}
```

不妨先考虑 $x<y<z$ 的情况。

设 $B=\lfloor\sqrt n\rfloor$，因为 $y^2<yz\le n$，所以 $y\le B$。

枚举 $y$，则 $1\le x<y$ 且 $y<z\le n/y$（这里 $/$ 表示整除）。

因此满足条件的 $(x,y,z)$ 组数为

$$S_{x<y<z}=\sum_{y=1}^B(y-1)(n/y-y)$$

同理可得：

$$S_{x=y<z}=\sum_{y=1}^B(n/y-y)$$

$$S_{x<y=z}=\sum_{y=1}^B(y-1)$$

$$S_{x=y=z}=B$$

根据基础的排列组合知识，最终的答案为：

$$S=6S_{x<y<z}+3(S_{x=y<z}+S_{x<y=z})+S_{x=y=z}$$

暴力计算每一项即可。

总时间复杂度为 $O(\sum \sqrt n)$。

```cpp
#include<bits/stdc++.h>
int main() {
    int T,s=0; scanf("%d",&T);
    while (T--) {
        const int n=(scanf("%d",&n),n),B=sqrt(n);
        for (int i=1; i<=B; ++i)
            s=(s+(6ll*i-3)*(n/i-i)+3*i-2)%998244353;
        printf("%d\n",s),s=0;
    }
    return 0;
}
```

## 思路

古话说得好：“由俭入奢易，由奢入俭难”！在写这道题时，看到数据范围，很容易看出这道题目需要一个 $O(T\times \sqrt N)$ 或者 $O(T\times \log N)$ 的做法，但是，在无法很快想到简便的做法的时候，我们可以先考虑打一个 $O(N)$ 的朴素做法，再慢慢优化。

我们枚举每个三元组 $\{x,y,z\}$ 的最大值 $i$，然后就可以得到一个次大值的取值上限 $pt$，易得 $pt=\min(i,\lfloor{N\over i}\rfloor)$，在这里，很容易错写为 $pt=\lfloor{N\over i}\rfloor$，但是要记住，次大值是肯定不能超过最大值的。

这样的话就会出现一个排列组合，非常简单，大家可以自己思考一下：

- 一个三元组 $\{a,a,a\}$（相同字母代表相同元素）有多少种不同的排列方式？  
> 很显然，答案为 $1$ 种，就是 $(a,a,a)$。  
- 一个三元组 $\{a,b,b\}$ 或 $\{a,a,b\}$（同上，$a\neq b$）有多少种不同的排列方式？  
> 枚举可得答案为 $3$ 种，分别是 $(a,b,b)$、$(b,a,b)$、$(b,b,a)$。  
- 一个三元组 $\{a,b,c\}$（$a\neq b\neq c$）有多少种不同的排列方式？  
> 经排列组合，答案为 $A^3_3=6$ 种。

那么我们只要枚举这三种三元组的个数即可。

当 $pt=i$ 时，那么可能会出现四种情况：

1. 三元组 $\{i,i,i\}$，只有 $1$ 个。  
2. 三元组 $\{i,j,j\}$（$i>j$），一共 $(i-1)\times 3$ 种。  
3. 三元组 $\{i,i,j\}$（$i>j$），一共 $(i-1)\times 3$ 种。  
4. 三元组 $\{i,j,k\}$（$i>k,j$，$j\neq k$），一共 ${(i-1)\times(i-2)\over 2}\times 6$ 种，化简可得 ${(i-1)\times(i-2)}\times 3$。  

当 $pt<i$ 时，会出现两种情况：

1. 三元组 $\{i,j,j\}$（$j\leq pt$），一共 $pt\times 3$ 种。  
2. 三元组 $\{i,j,k\}$（$k,j\leq pt$，$j\neq k$），一共 ${pt\times(pt-1)\over 2}\times 6$ 种，化简可得 ${pt\times(pt-1)}\times 3$。

于是我们可以做出一个 $O(T\times N)$ 的做法（不能通过所有测试点）：

对上述代码进行优化，我们很容易想到，当 $i$ 较大时，对于很多的 $i$，$pt=\lfloor{N\over i}\rfloor$ 的值是相同的，那么，我们将 $pt$ 相同的值进行合并计算即可。

## 代码
```cpp
#include <bits/stdc++.h>

using namespace std;

#define ll long long

const int mod = 998244353;

void solve() {
	ll N;
	cin>>N;
	ll pt=1;
	ll res=0;
	int ed=0;
	for(ll i=N;i>=1;) {
		pt=N/i;
		//cout<<i<<' '<<pt<<' ';
		if(pt>=i) {
			//cout<<(i-1)*(i-2)*6+(i-1)*3+(i-1)*3+1<<'\n';
			res+=(i-1)*(i-2)*3+(i-1)*6+1;
			res%=mod;
			--i;
		} else {
			//cout<<N/pt<<' '<<N/(pt+1)<<' ';
			ll zp=(pt*(pt-1)*3+pt*3)*(N/pt-N/(pt+1));
			//cout<<zp<<'\n';
			i=N/(pt+1);
			res+=zp;
			res%=mod;
		}
	} cout<<res<<'\n';
}
int main() {
	ios::sync_with_stdio(0);
	cin.tie(0);
	cout.tie(0);
	int t = 1;
	cin>>t;
	while (t--) solve();
	return 0;
}
```

时间复杂度 $O(T\times \sqrt n)$，可过。

# [ARC160B] Triple Pair

## Link

[Luogu](https://www.luogu.com.cn/problem/AT_arc160_b)

[AtCoder](https://atcoder.jp/contests/arc160/tasks/arc160_b)

## Description

**本题单测试点多组测试数据。**

每次给出一个正整数 $n$。求满足 $x,y,z \in N_{+}$ 且 $xy,xz,yz \leq n$ 有序三元组 $(x,y,z)$ 的个数，并输出答案对 $998244353$ 取模的结果。

## Solution

根据乘法的性质，若 $x \times y \leq n$，则 $x,y$ 中至多有一个大于 $\sqrt{n}$。设满足条件的三元组为 $\left (x,y,z \right )$。令 $x \leq y \leq z$。根据上述结论可以发现 $1 \leq y \leq \sqrt{n}$。我们可以枚举 $y$，根据题目限制得出 $1 \leq x \leq y \leq z \leq \left \lfloor \frac{n}{y} \right \rfloor$。

根据乘法原理，据此得到的答案数量为 $y \times y \times \left ( \left \lfloor \frac{n}{y} \right \rfloor - y\right )$。注意此时的 $x,y,z$ 是有大小关系的，

考虑如何据此计算正确答案，进行分类讨论：

- $x = y = z$ 时，排列只有一种。

- 有两个相同时，排列有三种。

- 全都不同时，排列有六种。

回到上面 $x,y,z$ 的范围：三者相同只有一种情况，$x = y$ 有 $\left \lfloor \frac{n}{y} \right \rfloor - y$ 种情况 $y = z$ 有 $y$ 种情况，剩余为三者不同。最终答案为即为 $\sum_{y = 1}^{\sqrt{n}}\left (6 \times \left  ( \left \lfloor \frac{n}{y} \right \rfloor - y \right ) \times \left (y - 1 \right )+ 3 \times  \left (\left \lfloor \frac{n}{y} \right \rfloor - y  - 1 \right ) + 1 \right )$。

时间复杂度为 $O(\sum{ \sqrt{n}})$。

## Codes

```cpp
#include <bits/stdc++.h>
using namespace std;
#define int long long
#define mo 998244353
void read(int &p)
{
    p = 0;
    int k = 1;
    char c = getchar();
    while (c < '0' || c > '9')
    {
        if (c == '-')
        {
            k = -1;
        }
        c = getchar();
    }
    while (c >= '0' && c <= '9')
    {
        p = p * 10 + c - '0';
        c = getchar();
    }
    p *= k;
    return;
}
void write_(int x)
{
    if (x < 0)
    {
        putchar('-');
        x = -x;
    }
    if (x > 9)
    {
        write_(x / 10);
    }
    putchar(x % 10 + '0');
}
void writesp(int x)
{
    write_(x);
    putchar(' ');
}
void writeln(int x)
{
    write_(x);
    putchar('\n');
}
int T, n;
signed main()
{

    read(T);
    while (T--)
    {
        read(n);
        int ans = 0;
        for (int i = 1; i <= sqrt(n); i++) // 枚举中间的数
        {
            int mx = n / i; // 最大的数
            ans = (ans + (mx - i) * (i - 1) * 6 % mo + 3 * (mx - 1) + 1) % mo;
        }
        writeln(ans);
    }
    return 0;
}
```
